import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const UserProfile = () => {
  const navigate = useNavigate();
  const [userColumns, setUserColumns] = useState([]);
  const [record, setRecord] = useState([]);
  const [movies, setMovies] = useState([]);
  const user_id = window.sessionStorage.getItem('user_id');

  useEffect(() => {
    if (!window.sessionStorage.getItem('auth')) navigate('/unauthorized');
    fetch('http://localhost:8000/users/user/' + user_id)
      .then((res) => res.json())
      .then((data) => {
        console.log(data);
        setUserColumns(Object.keys(data.User));
        setRecord(data.User);
      })
      .catch((error) => console.error(error));

    fetch('http://localhost:8000/ratings/' + user_id)
      .then((res) => res.json())
      .then((data) => {
        console.log(data);
        setMovies(data);
      })
      .catch((error) => console.error(error));
  }, []);

  const handleLogout = (e) => {
    e.preventDefault();
    window.sessionStorage.removeItem('auth');
    window.sessionStorage.removeItem('user_id');
    window.sessionStorage.removeItem('token');
    navigate('/login');
  };

  return (
    <div>
      <h2>User</h2>
      <table className="table">
        <thead>
          <tr>
            {userColumns.map((c, i) => (
              <th key={i}>{c.replaceAll('_', ' ').toUpperCase()}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {record.map((user, i) => (
            <tr key={i}>
              <td>{user.user_id}</td>
              <td>{user.first_name}</td>
              <td>{user.last_name}</td>
              <td className="hidetext">{user.password}</td>
              <td>{user.username}</td>
              <td>{user.email}</td>
              <td>{user.date_created}</td>
              <td>{user.is_active}</td>
              <td>{user.last_login}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <h2>Movies Rated by User</h2>
      <table className="table">
        <thead>
          <tr>
            <th>Movie ID</th>
            <th>Title</th>
            <th>Rating</th>
            <th>Comments</th>
          </tr>
        </thead>
        <tbody>
          {movies.map((movie, i) => (
            <tr key={i}>
              <td>{movie.movie_id}</td>
              <td>{movie.title}</td>
              <td>{movie.value}</td>
              <td>{movie.comments}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <button onClick={handleLogout}>Logout</button>
    </div>
  );
};

export default UserProfile;
